import { useState } from "react";
import "./app.css";
function App() {
  const [questionNumber, setQuestionNumber] = useState(1);
  const moneyPyramid = [
    { id: 1, amount: "$100" },
    { id: 2, amount: "$200" },
    { id: 3, amount: "$300" },
    { id: 4, amount: "$500" },
    { id: 5, amount: "$600" },
    { id: 6, amount: "$800" },
    { id: 7, amount: "$900" },
    { id: 8, amount: "$1000" },
    { id: 9, amount: "$1100" },
    { id: 10, amount: "$6800" },
    { id: 11, amount: "$10000" },
    { id: 12, amount: "$250000" },
    { id: 13, amount: "$109000" },
    { id: 14, amount: "$12300" },
    { id: 15, amount: "$1cr" },
  ].reverse();
  return (
    <div className="app">
      <div className="main">
        <div className="top">
          <div className="timer">30</div>
        </div>
        <div className="bottom"></div>
      </div>
      <div className="pyramid">
        <ul className="moneyList">
          {moneyPyramid.map((m) => (
            <li
              className={
                questionNumber == m.id
                  ? "moneyListItem active"
                  : "moneyListItem"
              }
            >
              <span className="moneyListItemNumber">{m.id}</span>
              <span className="moneyListItemNumber">{m.amount}</span>
            </li>
          ))}
        </ul>
      </div>
    </div>
  );
}

export default App;
